/**
 * @param {string} s
 * @return {number}
 */

var lengthOfLongestSubstring = function(s) {
  let i = 0
  let m = new Map()
  let max = 0
  while(i < s.length) {
    if(!(m.has(s[i]))) { 
      m.set(s[i], null)
      if(m.size > max) { 
        max = m.size
      }
    } else {
      i = i - m.size 
      m.clear()
    }
    i++
  }
  return max 
};

